import { HttpClient } from '@angular/common/http';
import { Component } from '@angular/core';
import { Router } from '@angular/router';
import * as Excel from '@grapecity/spread-excelio';
import * as GC from '@grapecity/spread-sheets';
import { Observable, ReplaySubject } from 'rxjs';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css'],
})
export class AppComponent {
  title = 'excelApp2';
  public spread!: GC.Spread.Sheets.Workbook;
  public excelIO;
  public url = 'assets/Files/Json Format.xlsx';
  public base64Output: string =
    '';
  public fileName: any;
  spreadBackColor = 'aliceblue';
  hostStyle = {
    width: '98vw',
    height: '98vh',
  };
  constructor(private http: HttpClient, public router: Router) {
    this.excelIO = new Excel.IO();
  }

  workbookInit(args: { spread: GC.Spread.Sheets.Workbook }) {
    const self = this;
    self.spread = args.spread;
    const sheet = self.spread.getActiveSheet();
    sheet.getCell(0, 0).text('Test ExcelIO').foreColor('blue');
    let req = this.http.get(this.url, { responseType: 'blob' });
    req.subscribe((data: any) => {
      this.convertFile(data).subscribe((base64) => {
        this.base64Output = base64;
        // console.log(this.base64Output);
        var file = new Blob([this.base64ToBlob(this.base64Output)], {
          type: 'blob',
        });
        // console.log(file);
        this.fileName = file;

        self.excelIO.open(file, (json: Object) => {
          // console.log(this.fileName);
          self.spread.fromJSON(json, {});
        });
      });
    });
  }
  convertFile(file: File): Observable<string> {
    const result = new ReplaySubject<string>(1);
    const reader = new FileReader();
    reader.readAsBinaryString(file);
    reader.onload = (event) =>
      result.next(btoa(event.target.result.toString()));
    return result;
  }

  //convert Base64 string to Blob
  public base64ToBlob(b64Data, sliceSize = 512) {
    let byteCharacters = atob(b64Data);
    let byteArrays = [];
    for (let offset = 0; offset < byteCharacters.length; offset += sliceSize) {
      let slice = byteCharacters.slice(offset, offset + sliceSize);

      let byteNumbers = new Array(slice.length);
      for (var i = 0; i < slice.length; i++) {
        byteNumbers[i] = slice.charCodeAt(i);
      }
      let byteArray = new Uint8Array(byteNumbers);
      byteArrays.push(byteArray);
    }
    return new Blob(byteArrays, { type: 'blob' });
  }
}
